import { Navbar } from 'react-bootstrap';
import styles from './Navbar.module.scss';

const Nav = () => {
  return (
    <Navbar>
      <div className="row">
        <div className={styles.logo}>Logo</div>
        <div className="">Search</div>
      </div>
    </Navbar>
  );
};

export default Nav;
